  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset captures the irrigation water
  lines running through and around the cemetery. The irrigation lines were compiled
  from utility lines collected with GPS equipment in the summer of 2003 and then merged
  with older irrigation line data originating from blueprints (Reconstruction and
  Extension of Utilities Blueprint sheet #3008A pages 1 of 19) provided by the LIBI
  staff and softcopy data available from the US Census Bureau. Originally the Little
  Bighorn Battlefield National Monument (LIBI) GIS program was created from academic
  research and coursework in the Department of Economics and Geography, United States
  Air Force Academy (USAFA). The GIS data was appended with GPS data in 2003 collect
  by NPS employees.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
